"use client";

import React, { useState, useEffect } from "react";
import { AppSidebar } from "../components/Sidebar";
import {
  Card,
  CardHeader,
  CardTitle,
  CardContent,
} from "@shadcn/ui/card";
import {
  Table,
  TableHeader,
  TableRow,
  TableHead,
  TableBody,
  TableCell,
} from "@shadcn/ui/table";
import { Input } from "@shadcn/ui/input";
import { Button } from "@shadcn/ui/button";
import { Checkbox } from "@shadcn/ui/checkbox";

const dummyArticles = [
  {
    id: 1,
    title: "How to Improve Your Skills in League of Legends",
    keyword: "league of legends [2240000]",
    words: 4575,
    createdOn: "20 hours ago",
    publish: true,
  },
  {
    id: 2,
    title: "How to Master Last Hitting in League of Legends",
    keyword: "league of legends [2240000]",
    words: 3480,
    createdOn: "21 hours ago",
    publish: true,
  },
  {
    id: 3,
    title: "7 Tips for Better Teamplay in League of Legends",
    keyword: "league of legends [2240000]",
    words: 2678,
    createdOn: "6 days ago",
    publish: false,
  },
  {
    id: 4,
    title: "Top Virtual Executive Assistant Services (2024)",
    keyword: "virtual executive assistant [2900]",
    words: 2408,
    createdOn: "1 Oct, 24",
    publish: true,
  },
  {
    id: 5,
    title: "Unlimited Graphics Design Solutions",
    keyword: "unlimited graphic design services [390]",
    words: 1793,
    createdOn: "1 Oct, 24",
    publish: false,
  },
];

export function DashboardPage() {
  const [articles, setArticles] = useState([]);
  const [filter, setFilter] = useState("");
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    setLoading(true);
    setTimeout(() => {
      setArticles(dummyArticles);
      setLoading(false);
    }, 1000);
  }, []);

  const filteredArticles = articles.filter(
    (article) =>
      article.title.toLowerCase().includes(filter.toLowerCase()) ||
      article.keyword.toLowerCase().includes(filter.toLowerCase())
  );

  return (
    <div className="flex min-h-screen">
      <AppSidebar />
      <main className="flex-1 p-6 bg-white">
        <Card>
          <CardHeader>
            <CardTitle>Articles</CardTitle>
            <div className="mt-2">
              <Input
                placeholder="Search for Title & Keywords..."
                value={filter}
                onChange={(e) => setFilter(e.target.value)}
                className="max-w-sm"
              />
            </div>
          </CardHeader>
          <CardContent>
            {loading ? (
              <div className="space-y-2 animate-pulse">
                <div className="h-6 bg-gray-200 rounded w-1/3"></div>
                <div className="h-6 bg-gray-200 rounded"></div>
                <div className="h-6 bg-gray-200 rounded"></div>
              </div>
            ) : (
              <Table>
                <TableHeader>
                  <TableRow>
                    <TableHead>
                      <Checkbox />
                    </TableHead>
                    <TableHead>Article Title</TableHead>
                    <TableHead>Keyword (Traffic)</TableHead>
                    <TableHead>Words</TableHead>
                    <TableHead>Created On</TableHead>
                    <TableHead>Action</TableHead>
                    <TableHead>Publish</TableHead>
                  </TableRow>
                </TableHeader>
                <TableBody>
                  {filteredArticles.length > 0 ? (
                    filteredArticles.map((article) => (
                      <TableRow key={article.id}>
                        <TableCell>
                          <Checkbox />
                        </TableCell>
                        <TableCell>{article.title}</TableCell>
                        <TableCell>{article.keyword}</TableCell>
                        <TableCell>{article.words}</TableCell>
                        <TableCell>{article.createdOn}</TableCell>
                        <TableCell>
                          <Button variant="outline" size="sm">
                            View
                          </Button>
                        </TableCell>
                        <TableCell>
                          {article.publish ? "Yes" : "No"}
                        </TableCell>
                      </TableRow>
                    ))
                  ) : (
                    <TableRow>
                      <TableCell colSpan={7} className="text-center py-4">
                        No results.
                      </TableCell>
                    </TableRow>
                  )}
                </TableBody>
              </Table>
            )}
          </CardContent>
        </Card>
      </main>
    </div>
  );
}
